def nested_parentheses(s):
    result = []
    for group in s.split(''):
        (count, max_count) = (0, 0)
        for ch in group:
            if ch == '(':
                count += 1
                max_count = max(max_count, count)
            elif ch == ')':
                count -= 1
        result.append(max_count)
    return result

